import React from 'react';

import { stySelect, styOption } from './styles';

const Dropdown = () => {
  return (
    <div>
      <div>Label</div>
      <select className={stySelect}>
        <option className={styOption} value="option 1">
          Option 1
        </option>
      </select>
    </div>
  );
};

export default Dropdown;
